Hi everyone! I am trying to use some JavaScript in Google Tag Manager with a listener for Google Analytics but the results I'm seeing in GA includes a 'submissionsGUID' that I do not want, can someone help as I am not a coder so am having trouble identifying the issue with the JS - I am including the script and a screenshot of the GA data below for reference:

&lt;script type="text/javascript"&gt;
 window.addEventListener("message", function(event) {
   if(event.data.type === 'hsFormCallback' &amp;&amp; event.data.eventName === 'onFormSubmit') {
     var emailField = event.data.data.find(function (field) {
       return field.name === "email";
     });
     var submittedEmail = emailField.value;
     window.dataLayer.push({
       'event': 'HubSpot-form-submit',
       'hs-form-guid': event.data.id,
       'hs-form-email': submittedEmail
     });
   }
 });
&lt;/script&gt;
